import * as React from 'react'
import './pageSeven.css'
import Title from './components/title_bar'
import Navbar from './components/nav_bar'

export default function Imprint(){
const [Lang,SetLang]=React.useState('EN')

let LangEN,LangDE;

if(Lang === 'EN'){
    LangEN = 'block'
    LangDE = 'none'
} else if (Lang === 'DE'){
    LangDE='block'
    LangEN='none'
}

    return(
     <div>

        <Title/>

        <Navbar onUpdate = {(value:string)=>SetLang(value)}/>

        <div className = "txt_box">
        <h1 style={{display:LangEN}}>Imprint</h1>
        <h1 style={{display:LangDE}}>Impressum</h1>
        <hr></hr>
        <p>
            <b>Declarations according to § 5 TMG</b>
            <b></b>
            Registered in the register of associations,city of Jülich, VR 227
        </p>

        </div>

     </div>

    )

}
